import React from 'react';

const OrderDetail = ({ order }) => {
  return (
    <div>
      <h3>Detalle del Pedido</h3>
      <p><strong>ID:</strong> {order.id}</p>
      <p><strong>Tienda:</strong> {order.store.name} - {order.store.description}</p>
      <p><strong>Cliente:</strong> {order.customer}</p>
      <p><strong>Vendedor:</strong> {order.salesPersonName}</p>
      <p><strong>Estado:</strong> {order.status}</p>
      <p><strong>Fecha de Creación:</strong> {order.createDate}</p>
      <p><strong>Fecha de Actualización:</strong> {order.updateDate}</p>
      <h4>Items del Pedido</h4>
      <ul>
        {order.orderItems.map(item => (
          <li key={item.id}>
            {item.hawa} - Cantidad: {item.quantity}, Precio: {item.price}, Descuento: {item.discount}
          </li>
        ))}
      </ul>
    </div>
  );
};

export default OrderDetail;
